import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Modal from 'react-modal';
import CreateEmployee from '../forms/CreateEmployee'; // Ensure this component is correctly imported
import Search from '../components/Search';

Modal.setAppElement('#root'); // Adjust according to your app's root element ID

const EmployeeList = () => {
    const [modalIsOpen, setModalIsOpen] = useState(false);
    const [employees, setEmployees] = useState([]);

    useEffect(() => {
        fetchEmployees();
    }, []);

    const fetchEmployees = async () => {
        try {
            const response = await axios.get('http://localhost:8000/employees');
            setEmployees(response.data);
        } catch (error) {
            console.error('Error fetching employees:', error);
        }
    };

    const handleOpenModal = () => {
        setModalIsOpen(true);
    };

    const handleCloseModal = () => {
        setModalIsOpen(false);
        fetchEmployees(); // Refetch employees to reflect any new additions
    };

    return (
        <div>
            <div className="fixed top-[8%] left-5">
                <button onClick={handleOpenModal} className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full shadow-lg">
                    <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth="2" className="w-6 h-6">
                        <path strokeLinecap="round" strokeLinejoin="round" d="M5 12h14m-7-7v14" />
                    </svg>
                </button>
            </div>
            <div className='relative py-4 ml-[84%]'>
                <Search />
            </div>
            <Modal
                isOpen={modalIsOpen}
                onRequestClose={handleCloseModal}
                contentLabel="Create Employee"
                className="modal-content"
                overlayClassName="modal-overlay"
            >
                <CreateEmployee closeModal={handleCloseModal} />
            </Modal>
            <table className="min-w-full table-auto">
                <thead className="bg-gray-800 text-white">
                    <tr>
                        <th className="px-4 py-2">ID</th>
                        <th className="px-4 py-2">Name</th>
                        <th className="px-4 py-2">Email</th>
                        <th className="px-4 py-2">Mobile No</th>
                        <th className="px-4 py-2">Designation</th>
                        <th className="px-4 py-2">Gender</th>
                        <th className="px-4 py-2">Course</th>
                        <th className="px-4 py-2">Create Date</th>
                        <th className="px-4 py-2">Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {employees.map((employee, index) => (
                        <tr key={employee.id} className={index % 2 === 0 ? "bg-gray-200" : "bg-white"}>
                            <td className="border px-4 py-2">{employee.id}</td>
                            <td className="border px-4 py-2">{employee.name}</td>
                            <td className="border px-4 py-2">{employee.email}</td>
                            <td className="border px-4 py-2">{employee.mobileNo}</td>
                            <td className="border px-4 py-2">{employee.designation}</td>
                            <td className="border px-4 py-2">{employee.gender}</td>
                            <td className="border px-4 py-2">{employee.course.join(", ")}</td>
                            <td className="border px-4 py-2">{employee.createDate}</td>
                            <td className="border px-4 py-2">Edit/Delete</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default EmployeeList;
